import React from 'react'
import Popup from './Popup'
import {useState} from 'react'
import SecondModal from './SecondModal';
import Confirm from './Confirm';

function RSVP () {

  const [openModal, setOpenModal] = useState(false);

  const[openSecondModal, setSecondModal] = useState(false);

  const[openConfirm, setConfirm] = useState(false);


  return (
    <div
      id='rsvp'
      className='section-padding bg-img'
    >
      <div className='container'>
        <div className='row justify-content-center'>
          <div className='col-md-6 bg-white p-40'>
            {' '}
            <h2 className='raman-title text-center'>R.S.V.P</h2>
            <br />
            <p>Will you attend?</p>

            <div className='item col-12 col-md-6'>
            <div className='whenwhere-img'>
              {' '}
              <img src={where1} alt='' />
            </div>
            <div className='edit-align content'>
              <h5 className='raman-title-meta'>Ceremony</h5>
              <p>
                <span className='where-p'>St. John Nepomucene Parish, Mojica, Alfonso, Cavite</span>
              </p>
              <p>
              <span className='where-p'>Ceremony will start at 2pm</span>
              </p>
            </div>
          </div>

            {openModal && <Popup closeModal={setOpenModal}/>}
            {openSecondModal && <SecondModal closeSecondModal={setSecondModal}/>}
            {openConfirm && <Confirm closeConfirm={setConfirm}/>}
          </div>
        </div>
      </div>
    </div>
  )
}

export default RSVP
